void genModel(unsigned char* data, unsigned char* output){
     /* Convert the OpenCV image from BGR to RGB */
    unsigned char* input = getInput();
    int num_row = 224;
    int num_col = 224;
    int num_channel = 3;
    
    for (int i = 0; i < num_row; i++) {
        for (int j = 0; j < num_col; j++) {
            uint8_t b = data[(i * num_col + j) * num_channel + 0];
            uint8_t g = data[(i * num_col + j) * num_channel + 1];
            uint8_t r = data[(i * num_col + j) * num_channel + 2];

            *input++ = (uint8_t)r;
            *input++ = (uint8_t)g;
            *input++ = (uint8_t)b;
            
        }
    }            
    printf("\n\n");
    for (int i=0;i<num_col;i++)
        printf("%4d ", data[i]);
    printf("\n\n");
    unsigned char* test = getInput();
    for (int i=0;i<num_col;i++)
        printf("%4d ", test[i]);
    printf("\n\n");        
    invoke_inf();
    
    unsigned char* out = getOutput();
    for(int i=0;i<1000;i++){
        output[i] = out[i];
    }
    }